export default function Card({Style, veiculos, filtrarVeiculos}) {
  return (
    <div className={Style.container__conteudo}>
      {veiculos.map((veiculo, index) => (
        <Cards
          filtrarVeiculos={filtrarVeiculos}

          key={veiculo.nome + index}
          nome={veiculo.nome}
          ano={veiculo.ano}
          imagem={veiculo.imagem}
          valor={veiculo.valor}
        />
      ))}
    </div>
  );
}
